const Logs = () => {
  return (
    <ul class='collection with-header'>
      <li class='collection-header center'>
        <h4>Logs</h4>
      </li>
      <li class='collection-item'>
        <div>
          <a href='#'>Clickable title to edit the log as modal</a>
          {/* <br /> */}
          <span>test</span>
        </div>
      </li>
      {/* <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li> */}
    </ul>
  );
};

export default Logs;
